import './style.css';
import logo from './../../img/logo.png'
import CardHome from '../../components/CardHome';


function Home() {

  return (
    <>

      <main className = 'main'>

        <img className = 'logo' src={logo} alt='logo steven universe'/>
        <div className="cardContainer">
          <CardHome title="Characters"/>
          <CardHome title="Episodes"/>
          <CardHome title="Songs"/>
        </div>
      </main>      
    </>
  );
}

export default Home;
